import React from 'react'
import { Box, Button, Grid, Typography } from '@mui/material'
import homeBanner from '../../Assets/Images/homebanner.jpg'
import { makeStyles } from '@material-ui/styles';
import { styled, alpha } from '@mui/material/styles';

import Menu from '@mui/material/Menu';
import MenuItem from '@mui/material/MenuItem';
import EditIcon from '@mui/icons-material/Edit';
import Divider from '@mui/material/Divider';
import ArchiveIcon from '@mui/icons-material/Archive';
import FileCopyIcon from '@mui/icons-material/FileCopy';
import MoreHorizIcon from '@mui/icons-material/MoreHoriz';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';

const useStyle = makeStyles({
    buttonStyle:{
        backgroundColor:'#e4002b !important' , 
        color:'white !important' , borderRadius:'25px !important',
      "&:hover": {
        backgroundColor: "none",
     }
    },
})


const HomeBanner = () => {
    const button = useStyle();
    const [anchorEl, setAnchorEl] = React.useState(null);
  const open = Boolean(anchorEl);
  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };
  const handleClose = () => {
    setAnchorEl(null);
  };
  return (
    <Box sx={{background: 'rgb(247, 247, 247)'}}  mt={0}>
        <Grid container p={0}>
            <Grid lg={6} sm={12} p={4} pt={0} mt={4} mb={0}>
                    <Typography variant='h4' fontWeight={600}>
                    Lets Find the right project option for you
                </Typography>
                <Typography>
                    Get Some Project Value and see selling option
                </Typography>
                <Box mt={2}>
                <Button className={button.buttonStyle} 
                   aria-controls={open ? 'demo-customized-menu' : undefined}
                   aria-haspopup="true"
                   aria-expanded={open ? 'true' : undefined}
                   variant="contained"
                   disableElevation
                   onClick={handleClick}
                   endIcon={<KeyboardArrowDownIcon />}

                >
                   Start Exploring
                </Button>
                <StyledMenu
        id="demo-customized-menu"
        MenuListProps={{
          'aria-labelledby': 'demo-customized-button',
        }}
        anchorEl={anchorEl}
        open={open}
        onClose={handleClose}
      >
        <MenuItem onClick={handleClose} disableRipple>
          <EditIcon />
          Edit
        </MenuItem>
        <MenuItem onClick={handleClose} disableRipple>
          <FileCopyIcon />
          Duplicate
        </MenuItem>
        <Divider sx={{ my: 0.5 }} />
        <MenuItem onClick={handleClose} disableRipple>
          <ArchiveIcon />
          Archive
        </MenuItem>
        <MenuItem onClick={handleClose} disableRipple>
          <MoreHorizIcon />
          More
        </MenuItem>
      </StyledMenu>
              
                </Box>
               
            </Grid>
            <Grid lg={6} sm={12} pb={0}>
                <Box sx={{height:'230px'}}>
                  <img src={homeBanner} alt='' style={{width:'100%' , height:'100%'}}/>

                </Box>
                

            </Grid>
     
            
        </Grid>
       


    </Box>
  )
}

export default HomeBanner
